class User {
    constructor({ Id_osoba, Imie, Nazwisko, Rodzaj, Adres }) {
        this.Id_osoba = Id_osoba;
        this.Imie = Imie;
        this.Nazwisko = Nazwisko;
        this.Rodzaj = Rodzaj;
        this.Adres = Adres;
    }

}

export default User
